public class Region {
	
	private String reg_id;//编号
	private String reg_name;//大区名字
	
	/**
	 * 
	* <p>Title: 无参构造方法</p> 
	* <p>Description: </p>
	 */
	public Region() {
		super();
		// TODO Auto-generated constructor stub
	}
	/**
	 * 
	* <p>Title:有参构造方法 </p> 
	* <p>Description: </p> 
	* @param reg_id
	* @param reg_name
	 */
	public Region(String reg_id, String reg_name) {
		super();
		this.reg_id = reg_id;
		this.reg_name = reg_name;
	}
	/* 
     *  set get
	 */
	public String getReg_id() {
		return reg_id;
	}
	public void setReg_id(String reg_id) {
		this.reg_id = reg_id;
	}
	public String getReg_name() {
		return reg_name;
	}
	public void setReg_name(String reg_name) {
		this.reg_name = reg_name;
	}
	@Override
	public String toString() {
		return "Region [reg_id=" + reg_id + ", reg_name=" + reg_name + "]";
	}
	
	
	

}
